import { Document, Page } from "react-pdf";

import samplePDF from "./Resume-KennonDong.pdf"

function ResumePage(){
    return (
        <div>
            <Document file={samplePDF}>
                <Page pageNumber={1}/>
            </Document>
        </div>
    );
}

export default ResumePage;
